import axios from 'axios';
import React from 'react';
import { useState } from 'react';
import {useNavigate} from 'react-router'
const Login = () => {
    let[data, setData] = useState({
      username:"",
      password:""
    });

    return(
        <>
        
        <div className="wrapper fadeInDown">
        <div id="formContent">
        
            <div className="fadeIn first">
                <img src="https://cdn-icons-png.flaticon.com/512/5087/5087579.png" id="icon" alt="User Icon" />
            </div>
            <input type="text" onChange={(e)=>{ textchanged(e) }}
                value={data.username} id="username" className="fadeIn second" for="password" placeholder="username" />
            
            <input type="text" onChange={(e)=>{ textchanged(e) }}
                value={data.password} id="password" className="fadeIn third" for="password" placeholder="password"/>
            
            <input type="submit" onClick={(e)=>{login(e)}} className="fadeIn fourth" value="Log In"/>            
            <div id="formFooter">
                <a className="underlineHover" href="#">Forgot Password?</a>
            </div>

        </div>
    </div>
        </>
        
    )
}

export default Login;
